    // const handleClickModelClose=(data)=>{
    //     console.log(data);
    //     setModelOpen(false);
    // }
    return (
        <Container>
            <Box my={2}>
                <Usertable columns={userColumns} title={'User List'} />
                <Eventtable columns={eventColumns} title={'Event List'} />            
                
            </Box>
        </Container>



    );
}

export default Tablecontainer;
